import React from "react";
import { StyledBottomBar, StyledIcon } from "./styles";
import { FaFacebookSquare } from "react-icons/fa";
import { GrInstagram } from "react-icons/gr";

export const BottomBar = () => {
  return (
    <StyledBottomBar>
      <StyledIcon>
        <FaFacebookSquare />
      </StyledIcon>
      <StyledIcon>
        <GrInstagram />
      </StyledIcon>
      <StyledIcon>
        <GmailIcon />
      </StyledIcon>
      <StyledIcon>
        <PhoneIcon />
      </StyledIcon>
    </StyledBottomBar>
  );
};
